import React from "react";
import classes from './Header.module.css'

function Header(){
    return (
        <header className={classes.header}>
        <img alt='' src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRmg6VbQr7k4bE8m1sGjODK19nEZn-UKVChBg&usqp=CAU' />
      </header>
    )
}

export default Header
